	<div id="content">
	<p class="P4">Rapport</p><p class="P1"> <span class="T1">BRUYER Arnaud &amp; DUPLAT Anthony</span></p><p class="P1"> </p><p class="P2">Temps de travail pour la réalisation du projet :</p><p class="P3"> </p><table border="0" cellspacing="0" cellpadding="0" class="Tableau1"><colgroup><col width="210"/><col width="200"/></colgroup><tr class="Tableau11"><td style="text-align:left;width:4.815cm; " class="Tableau1_A1"><p class="P18">Anthony</p></td><td style="text-align:left;width:4.577cm; " class="Tableau1_B1"><p class="P18">30h</p></td></tr><tr class="Tableau11"><td style="text-align:left;width:4.815cm; " class="Tableau1_A2"><p class="P18">Arnaud</p></td><td style="text-align:left;width:4.577cm; " class="Tableau1_B2"><p class="P19">30h</p></td></tr><tr class="Tableau11"><td style="text-align:left;width:4.815cm; " class="Tableau1_A2"><p class="P21">Total</p></td><td style="text-align:left;width:4.577cm; " class="Tableau1_B2"><p class="P19">60h</p></td></tr></table><p class="P5"> </p><p class="P9">Répartition des tâches :</p><p class="P9"> </p><table border="0" cellspacing="0" cellpadding="0" class="Tableau2"><colgroup><col width="351"/><col width="328"/></colgroup><tr class="Tableau21"><td style="text-align:left;width:8.043cm; " class="Tableau2_A1"><p class="P20">Anthony</p></td><td style="text-align:left;width:7.514cm; " class="Tableau2_B1"><p class="P20">Arnaud</p></td></tr><tr><td style="text-align:left;width:8.043cm; " class="Tableau2_A2"><ul><li><p class="P24" style="margin-left:0cm;"><span class="Bullet_20_Symbols" style="display:block;float:left;min-width:0,635cm;">•</span>Mise en place de la structure MVC (réalisation du dossier <span class="T2">core</span> et de son contenu, mise en place du routeur...).<span class="odfLiEnd"/> </p></li><li><p class="P24" style="margin-left:0cm;"><span class="Bullet_20_Symbols" style="display:block;float:left;min-width:0,635cm;">•</span>Réalisation des modèles.<span class="odfLiEnd"/> </p></li><li><p class="P24" style="margin-left:0cm;"><span class="Bullet_20_Symbols" style="display:block;float:left;min-width:0,635cm;">•</span>Réalisation de la partie PHP de l'intégralité de la page d'accueil (contrôleur + vue).<span class="odfLiEnd"/> </p></li><li><p class="P24" style="margin-left:0cm;"><span class="Bullet_20_Symbols" style="display:block;float:left;min-width:0,635cm;">•</span>Correction de certain bug CSS (débordement du texte).<span class="odfLiEnd"/> </p></li><li><p class="P24" style="margin-left:0cm;"><span class="Bullet_20_Symbols" style="display:block;float:left;min-width:0,635cm;">•</span>Conception du contrôleur pour l’édition, l'ajout de posts et la suppression des articles.<span class="odfLiEnd"/> </p></li><li><p class="P24" style="margin-left:0cm;"><span class="Bullet_20_Symbols" style="display:block;float:left;min-width:0,635cm;">•</span>Conception de la récupération des commentaires au niveau du contrôleur des articles '<span class="T2">Posts.php</span>'<span class="odfLiEnd"/> </p></li><li><p class="P24" style="margin-left:0cm;"><span class="Bullet_20_Symbols" style="display:block;float:left;min-width:0,635cm;">•</span>Gestion de la connexion d'un <span class="T12">éditeur</span><span class="odfLiEnd"/> </p></li><li><p class="P25" style="margin-left:0cm;"><span class="Bullet_20_Symbols" style="display:block;float:left;min-width:0,635cm;">•</span>Rédaction de la description du logiciel<span class="odfLiEnd"/> </p></li><li><p class="P25" style="margin-left:0cm;"><span class="Bullet_20_Symbols" style="display:block;float:left;min-width:0,635cm;">•</span>création des diagrammes de classes<span class="odfLiEnd"/> </p></li></ul></td><td style="text-align:left;width:7.514cm; " class="Tableau2_B2"><ul><li><p class="P26" style="margin-left:0cm;"><span class="Bullet_20_Symbols" style="display:block;float:left;min-width:0,635cm;">•</span>Réalisation des différentes vues de l'espace d'administration.<span class="odfLiEnd"/> </p></li><li><p class="P26" style="margin-left:0cm;"><span class="Bullet_20_Symbols" style="display:block;float:left;min-width:0,635cm;">•</span>Conception des vues des posts<span class="odfLiEnd"/> </p></li><li><p class="P26" style="margin-left:0cm;"><span class="Bullet_20_Symbols" style="display:block;float:left;min-width:0,635cm;">•</span>Conception de la vue et du contrôleur du profil de l'utilisateur<span class="odfLiEnd"/> </p></li><li><p class="P26" style="margin-left:0cm;"><span class="Bullet_20_Symbols" style="display:block;float:left;min-width:0,635cm;">•</span>Conception du Layout<span class="odfLiEnd"/> </p></li><li><p class="P26" style="margin-left:0cm;"><span class="Bullet_20_Symbols" style="display:block;float:left;min-width:0,635cm;">•</span>Réalisation des différents formulaires<span class="odfLiEnd"/> </p></li><li><p class="P26" style="margin-left:0cm;"><span class="Bullet_20_Symbols" style="display:block;float:left;min-width:0,635cm;">•</span>Ajouts CSS en complément du framework<span class="odfLiEnd"/> </p></li><li><p class="P26" style="margin-left:0cm;"><span class="Bullet_20_Symbols" style="display:block;float:left;min-width:0,635cm;">•</span>Gestion des notifications des différents formulaires (vues)<span class="odfLiEnd"/> </p></li></ul></td></tr></table><p class="P9"> </p><p class="P10">Particularité de notre application :</p><p class="P13"><span class="T9">Notre </span><span class="T10">blog a été designer grâce au framework css </span><span class="T11">Metro UI </span><span class="T10">sélectionné par Arnaud en personne. </span></p><p class="P7">Les rédacteurs ont la possibilité de rendre publique ou non leur adresse mail.</p><p class="P7">En consultant le profil d'un rédacteur on a la possibilité de voir la liste des articles qu'il a rédigé.</p><p class="P14"><span class="T10">L</span><span class="T3">'application utilise un fichier de configuration pour la connexion à la base de données présent dans le dossier </span><span class="T11">core</span><span class="T3">.</span></p><p class="P10"> </p><p class="P11">Notions de cour<span class="T13">s</span> appliqués dans ce projet :</p><p class="P6">Réalisation d'un site fonctionnant sous le principe du modèle MVC.</p><p class="P12"><span class="T5">Utilisation de </span><span class="T6">l</span><span class="T4">'extension </span><span class="Emphasis"><span class="T8">P</span></span><span class="Emphasis"><span class="T7">HP Data Objects</span></span><span class="T4"> (</span><span class="acronym"><span class="T4">PDO</span></span><span class="T4">).</span></p><p class="P6">Utilisation de la fonction <span class="T2">__autoload()</span>.</p><p class="P8">Programmation sous forme orienté objet.</p><p class="P8"> </p><p class="P23">Comparaison avec PluXml :</p><!--Next 'div' was a 'text:p'.--><div class="P22"><!--Next '
			span' is a draw:frame.
		--><span style="height:21.544cm;width:15.55cm; padding:0; " class="fr1" id="Image2"><img style="height:21.544cm;width:15.55cm;" alt="" src="data:image/*;base64,"/></span></div><div style="clear:both; line-height:0; width:0; height:0; margin:0; padding:0;"> </div><p class="P22"><a href="http://demo.pluxml.org/" class="Internet_20_link">http://demo.pluxml.org/</a></p><p class="P22"> </p><p class="P22"> </p><p class="P15">La présentation des articles est assez similaire. </p><p class="P15">Le panel d'administration de PluXml est beaucoup plus complet et travaillé que le notre.</p><p class="P17">Il y a une gestion des archives et le contenu de la page principale permet une navigation plus fluide que sur notre blog.</p><p class="P17">PluXml permet aussi de gérer les flux RSS de son blog.</p><p class="P17">Il n'utilise aucune base de données, permet de changer de thème et d'installer des plugins.</p><p class="P16">Néanmoins, notre blog semble bien plus adapté aux mobiles que PluXML.</p><p class="P11"> </p>
	</div>